import React from 'react';
import useFetch from './FechData';
const Electronics = () => {
   let data,isPending,error;
   UseEffect(()=>{
      const output=useFetch("");
      data=output.data;
      isPending=output.isPending;
      error=output.error;
   },[]);
    return ( 
        <div>
           {data&&<p>data</p>}
           {isPending&&<p>Ispending.......</p>}
           {error&&<p>Something went Wrong.......</p>}
        </div>
     );
}
 
export default Electronics;
